import React from 'react';
import { FaPlusSquare } from 'react-icons/fa';
import Popup from 'reactjs-popup';


export default function InformationCubesPlus() {

    return (
        <Poput trigger={
            <button className='information-cube-plus-button'>
            <FaPlusSquare className='fa-sizing'/>
            </button>
        }></Poput>



    )
}
